export const styleSheet = () => ({
  root: {
    //
    display: "flex",
    alignItems: "center",
    color: "#FF6800",
    "& p": {
      //   fontFamily: "Poppins",
      fontStyle: "normal",
      fontWeight: 500,
      fontSize: "18px",
      lineHeight: "24px",
      margin: 0,
      marginLeft: "10px",
    },
  },
});
